struct Entry
{
    uint32_t hash;
    uint32_t payload;
};

const Entry * lookup(const Entry * it, size_t nleft, uint32_t hash)
{
    if (nleft > 0)
    {
        while (size_t half = nleft >> 1)
        {
            const Entry * mid = &it[half];
            __builtin_prefetch(&it[half >> 1], 0);
            __builtin_prefetch(&mid[half >> 1], 0);
            it = (mid->hash < hash) ? mid : it;
            nleft -= half;
        }

        it += (it->hash < hash);
    }

    return it;
}
